import React, { useEffect, useState } from 'react';
import axios from 'axios';
import { Card, Row, Col, Container } from "react-bootstrap";

const API_URL = "http://localhost:5009/api/company";
const CardObject = ({ objectData, companyId, identifiers }) => {
  const [objectCards, setObjectCards] = useState([]);

  useEffect(() => {
    const fetchObjectCards = async () => {
      try {
        const response = await axios.post(`${API_URL}/getObjCards`, {
          companyId,
          identifiers,
        });
        setObjectCards(response.data);
      } catch (error) {
        console.log('Ошибка при получении карточек объектов:', error);
      }
    };

    fetchObjectCards();
  }, [companyId, identifiers]);
  return (
    <Card border="primary" style={{ margin: 30 }}>
    <Card.Body>
      <Card.Header>• Объект "{objectData.name}"</Card.Header>
      <Card.Text>
        <Container style={{margin:10}}>
          <Row>
            <Col md={4}>
              <strong className="mb-1">Регистрационный номер:</strong> {objectData.registry_number}
            </Col>
            <Col md={4}>
              <strong className="mb-1">Date Entry:</strong> {objectData.date_entry}
            </Col>
            <Col md={4}>
              <strong className="mb-1">Kind Object:</strong> {objectData.kind_object}
            </Col>
          </Row>
          <Row>
            <Col md={4}>
              <strong className="mb-1">Тип объекта:</strong> {objectData.type_object}
            </Col>
            <Col md={4}>
              <strong className="mb-1">Адрес:</strong> {objectData.address}
            </Col>
            <Col md={4}>
              <strong className="mb-1">Субъект РФ:</strong> {objectData.subject_rf}
            </Col>
          </Row>
          <Row>
            <Col md={4}>
              <strong className="mb-1">Settlement:</strong> {objectData.settlement}
            </Col>
            <Col md={4}>
              <strong className="mb-1">Index:</strong> {objectData.index}
            </Col>
            <Col md={4}>
              <strong className="mb-1">Basis Inclusion:</strong> {objectData.basis_inclusion}
            </Col>
          </Row>
          <Row>
            <Col md={4}>
              <strong className="mb-1">Date Categorization:</strong> {objectData.date_categorization}
            </Col>
            <Col md={4}>
              <strong className="mb-1">Category:</strong> {objectData.category}
            </Col>
            <Col md={4}>
              <strong className="mb-1">Basis Changes:</strong> {objectData.basis_changes}
            </Col>
          </Row>
          <Row>
            <Col md={4}>
              <strong className="mb-1">Date Changes:</strong> {objectData.date_changes}
            </Col>
            <Col md={4}>
              <strong className="mb-1">Date Changes Category:</strong> {objectData.date_changes_category}
            </Col>
            <Col md={4}>
              <strong className="mb-1">Category Changes:</strong> {objectData.category_changes}
            </Col>
          </Row>
          <Row>
            <Col md={4}>
              <strong className="mb-1">Basis Removal:</strong> {objectData.basis_removal}
            </Col>
            <Col md={4}>
              <strong className="mb-1">Date Removal:</strong> {objectData.date_removal}
            </Col>
          </Row>
        </Container>
      </Card.Text>
    </Card.Body>
  </Card>
  );
};

export default CardObject;
